import React from 'react'
import styled from 'styled-components'

const Category = () => {
  return (
    <Wrapper className='p-3' >
      <h1 className='display-6 ' >Category</h1>
    </Wrapper>
    
  )
}

export default Category

const Wrapper = styled.div`
  background-color: white;
  border-radius: 1rem;
`
